import React, { useState } from "react";
import Simonsgame from "./components/assets/images/simons-game.png";

const {project1ClassName} = useState("slide-item");

const projects = [
    {
        id: 1,
        projectCLASS: {project1ClassName},
        projectIMG: Simonsgame,
        projectALT: "slide 1"
    }];

export default projects;
